import React, { Component } from 'react';

import '../css/cssPageLogin.css';
import { Redirect } from 'react-router-dom';
import { ContextoUsuario } from '../components/Session';


export default class PageUsuarioLog extends Component {
    
    static contextType = ContextoUsuario;

    state = {
        user : {},
        redireciona : false
    }

    componentDidMount() {
        let { usuarioAutenticado } = this.context;
        let bRedireciona = false;

        if(usuarioAutenticado == null) {
            bRedireciona = true;
        }

        this.setState({
            user : this.context.usuarioAutenticado,
            redireciona : bRedireciona
        });
    }

    componentDidUpdate() {
        let { usuarioAutenticado } = this.context;

        if(!(usuarioAutenticado == null)) {
            return
        }

        this.setState({
            redireciona : true
        });
    }

    redireciona = ()=> {
        if(!this.state.redireciona) {
            return;
        }

        return <Redirect  to={`/`} />;
    }

    render() {
        const { user } = this.state;

        return (
            <div className="login-main-container">
                {this.redireciona()}
                <header>
                    <ul>
                        <li>Perfil</li>
                        <li>Endereco de Entrega</li>
                        <li>Pedidos</li>
                    </ul>
                </header>
                <hr/>
                <div className="login-container">
                    <h3>Dados Cadastrais</h3>
                    <hr/>
                    <ul>
                        <li>
                            <header><strong>Nome Completo</strong></header>
                            <footer>{user.nome}</footer>
                        </li>
                        <li>
                            <header><strong>E-mail</strong></header>
                            <footer>{user.email}</footer>
                        </li>
                        <li>
                            <header><strong>CPF</strong></header>
                            <footer>{user.cpf}</footer>
                        </li>
                        <li>
                            <header><strong>ID</strong></header>
                            <footer>{user.id}</footer>
                        </li>
                    </ul>
                    {/* <h3>Contato</h3>
                    <hr/>
                    <ul>
                        <li>
                            <header><strong>Telefone</strong></header>
                            <footer>{user.telefone}</footer>
                        </li>
                    </ul> */}
                </div>
            </div>
        );
    };

}
